import React from "react";
import Header from "../Header/Header";
import SideBar from "../SideBar/SideBar";
import Body from "./Body/Body";

 export default function MainComp(){
    return(
        <>  
        <div className="main">
            <Body />
            <Header />
            <SideBar />
            </div>
        </>
    )
 }
